import React, { Component } from 'react'
import { View, Text } from 'react-native'
import styles from './Footer.styles'

class Footer extends Component {
  render() {
    return (
      <View style={styles.footer}>
        <Text>this is footer</Text>
      </View>
    )
  }
}

export default Footer
